measurements.description:
Approximately one thousand four hundred fifty tiny flowers and approximately 1200 buds on 18 14-cm branched inflorescences;
	8 immature inflorescences;
	47x22-cm plant, foliage in excellent condition, grown on 9x14-cm cork slab; 
	dorsal sepal violet; lateral sepals white, overlaid violet proximally;
	petals violet;
	lip white, spur violet;

	substance not described; texture matte.
